import React from 'react';

import { Form } from 'react-bootstrap';

const formList = (): JSX.Element => {
    return <>
    <section></section>
        <Form.Group>
            <Form.Control type="text" placeholder="Normal text" />
            <br />
        </Form.Group>
    </>
}

export default formList
